INSERT INTO `pilih_film` (`Id_film`, `Judul`, `Sinopsis`, `Genre`, `Foto_film`, `Id_Admin`, `desk_sunting`, `tanggal_sunting`) VALUES
(1, 'Sewu Dino', 'Menceritakan tentang seorang gadis desa bernama Sri yang sedang mencari pekerjaan di kota.  Kemudian dia bertemu dengan keluarga Atmojo yang mau membayar Sri Rp. 5 juta untuk menjadi perawat.  Namun syarat untuk diterima bekerja adalah lahir di hari Jumat Kliwon, yang kebetulan Sri lahir di hari yang sama.  Singkat cerita, Sri berhasil mendapatkan pekerjaan itu dan tinggal di kediaman keluarga Atmojo.  Sri harus merawat Della Atmojo, gadis SMU yang sakit parah dan badannya berbau busuk.  Ternyata Della merupakan korban santet Sewu Dino yang menghabiskan nyawa satu trah keluarga.  Tidak hanya keluarga, orang yang merawat korban santet ini juga bakal terkena kutukan tersebut. \nBagaimanakah nasib Sri selanjutnya?', 'Horor, Misteri', , '-', '-', '2023-05-31 04:23:38'),
(2, 'Jalan Yang Jauh Jangan Lupa Pulang', 'Berkisah tentang kehidupan Aurora (Sheila Dara Aisha) yang merantau ke London, Inggris, guna mengejar cita-citanya. Ia kemudian harus berjuang keras untuk bisa bertahan hidup di negeri orang dan jauh dari keluarganya.\nAurora tinggal di London bersama temannya, Honey, Honey memiliki karakter pekerja keras dan sudah dianggap sebagai kakak sendiri oleh Aurora .Selain itu, Aurora ditemani oleh teman lainnya, yaitu Kit yang merupakan laki-laki keturunan Jerman-Thailand Sama seperti Honey, Kit merupakan sosok pekerja keras untuk meraih mimpi di London. Sayangnya, menetap di London membuat Aurora sempat hilang kontak dengan keluarganya di Indonesia.\nHal ini membuat Angkasa (Rio Dewanto) dan Awan (Rachel Amanda) memutuskan untuk mencari Aurora ke London. Angkasa dan Awan merasa Aurora sedang dalam kesulitan untuk bertahan hidup di London.\nMereka akhirnya berusaha membujuk Aurora untuk kembali ke Indonesia. Namun, Aurora tidak mudah dibujuk. Bisakah Awan dan Angkasa membujuknya?', 'Drama, Keluarga.', , '-', '-', '2023-05-31 04:42:23');
INSERT INTO `pilih_film` (`Id_film`, `Judul`, `Sinopsis`, `Genre`, `Foto_film`, `Id_Admin`, `desk_sunting`, `tanggal_sunting`) VALUES
(3, 'Hati Suhita', 'Menceritakan kisah perjalanan hidup seorang santriwati bernama Alina Suhita (Nadya Arina) yang menikah karena dijodohkan. Perjodohan ini telah direncanakan sejak Suhita masih kecil, ia hendak dinikahkan dengan seseorang bernama Gus Birru (Omar Daniel). Suhita pun mendapatkan berbagai macam bekal untuk mempersiapkan dirinya menjadi istri Gus Birru. \nNamun, keadaan yang tidak mengenakan pun terjadi pada Suhita. Ketika ia telah menikah, Gus Birru justru mengatakan bahwa ia menikahi Suhita hanya karena permintaan orang tuanya. Gus Birru sama sekali tidak menginginkan pernikahan ini dan tidak pernah mencintai Suhita karena ia telah mempunyai pujaan hati lain. Gus Birru yang telah jatuh cinta dengan gadis bernama Ratna Rengganis (Anggika Bolsterli) ini pun tidak pernah menyentuh Suhita. Mengetahui hal itu, Suhita pun merasa sedih dan kesepian ketika menjalani pernikahan yang tanpa cinta itu. \nLantas, bagaimana kisah Suhita? Mampukah ia mempertahankan pernikahannya?', 'Drama, Romansa.', , '', '', '2023-06-07 12:25:04');
INSERT INTO `pilih_film` (`Id_film`, `Judul`, `Sinopsis`, `Genre`, `Foto_film`, `Id_Admin`, `desk_sunting`, `tanggal_sunting`) VALUES
(4, 'Hello Ghost', 'Kresna (Onadio Leonardo) memiliki kehidupan yang pelik. Ia pun mencoba untuk bunuh diri. Namun, percobaan bunuh diri tersebut gagal. Setelah percobaan bunuh dirinya gagal, Kresna mendapati dirinya dapat melihat empat hantu dengan karakter yang berbeda-beda.\nKuatno (Indro Warkop), hantu tua bangka yang mata keranjang, Bima (Tora Sudiro) hantu perokok yang dulunya adalah supir angkot, Lita (Hesti Purwadinata) hantu melankolis yang mudah menangis, dan Chika (Clara Nadine Brosnan) hantu kecil yang senang menggunakan sepatu roda. Keempat hantu ini mengikuti Kresna kemanapun ia pergi. Mereka hanya akan pergi jika Kresna mau memenuhi permintaan mereka masing-masing.\n Kresna tidak berdaya, akhirnya menuruti keinginan mereka. Namun ternyata, dalam proses menuntaskan misi tersebut, Kresna sendiri yang menemukan makna baru bagi hidupnya dan juga cintanya pada Suster Linda (Enzy Storia).', 'Horor, Komedi, Drama.', , 'Adm-1-xxi5', 'Menyunting Data Film', '2023-06-08 04:38:50'),
(5, 'Spider-Man: Across The Spider-Verse', 'Mengisahkan tentang kehidupan dari Miles Morales (Shameik Moore). Dia dipertemukan lagi dengan Gwen Stacy (Hailee Steinfeld). Miles pergi multiverse lain dimana para Spiderman yang berasal dari berbagai semesta lain berada. Mereka sedang menghadapi ancaman dan musuh baru. Oleh sebab itu, mereka harus bekerja sama untuk mengalahkannya. Alih-alih menyatukan kekuatan, Miles justru harus melawan para Spiderman lainnya. Hal itu membuatnya harus menemukan makna sesungguhnya dari menjadi seorang superhero. Miles cuma berkeinginan untuk melindungi dan menyelamatkan banyak orang, terutama orang yang dia sayangi. Dia mengalami sebuah petualangan baru sejak Gwen kembali.', 'Animasi, Laga, Petualangan, Fiksi Ilmiah', , 'Adm-2-xxi5', 'Menyunting Data Film', '2023-06-07 13:57:03');
INSERT INTO `pilih_film` (`Id_film`, `Judul`, `Sinopsis`, `Genre`, `Foto_film`, `Id_Admin`, `desk_sunting`, `tanggal_sunting`) VALUES
(6, 'Evil Dead Rise', 'Bercerita tentang dua saudara perempuan, Jessica dan Beth. Mereka berdua mencoba untuk memulai hidup baru di kota setelah kehilangan ibu mereka akibat kanker. Mereka berdua bekerja sebagai pelayan di sebuah restoran. Namun, mereka berdua masih merasa kesulitan dalam memulai hidup baru. Suatu hari, mereka menemukan Necronomicon, sebuah buku sihir kuno yang sangat kuat dan berbahaya.\nKetika mereka membaca mantra yang terdapat dalam buku tersebut. Sesaatnya, tanpa disadari mereka memanggil roh jahat yang berada di dalam buku tersebut. Roh jahat tersebut menempati tubuh seorang pria dan menginfeksi seluruh kota. Jessica dan Beth harus berjuang untuk bertahan hidup dan menghentikan roh jahat tersebut sebelum roh jahat tersebut menyebar ke seluruh dunia.\nDalam perjalanan mereka, Jessica dan Beth bertemu dengan kelompok orang yang berjuang untuk bertahan hidup di tengah wabah roh jahat tersebut. Mereka harus berjuang dengan segala kekuatan mereka untuk melawan kekuatan roh jahat yang sangat kuat dan berbahaya.', 'Supernatural, Horor, Misteri', , '-', '-', '2023-05-31 07:01:32'),
(7, 'Transformers Rise of The Beast', 'Menceritakan tentang perseteruan antar kelompok robot alien, salah satunya Beast War. Beast War adalah robot alien yang dapat mengubah bentuknya menjadi binatang, bukan kendaraan seperti dalam sekuel film Transformers sebelumnya. Dalam film ini yang mengambil latar waktu tahun 1994 ini, Optimus Prime akan bertemu dengan Optimus Primal, yaitu autobots berbentuk gorila. Pada pertemuan tersebut, Optimus Primal mengingatkan Optimus Prime akan datangnya suatu ancaman dari makhluk lain yang sangat besar.\nDi tengah perjalanannya, Optimus Prime akan dibantu oleh Noah, seorang pria asal Brooklyn bersama peneliti artefak berbakat Elena untuk mengatasi perseteruannya dengan musuh bernama Scourge. Selain itu, dalam film ini akan ditampilkan juga aksi perseteruan yang terjadi dari kelompok robot Maximals, Predacons, dan Terrorcons bergabung dalam pertempuran antara Autobots dan Decepticons di Bumi.\nAdapun Autobots baru yang akan muncul menghiasi aksi pertarungan para robot, di antaranya yaitu Wheeljack dan Mirage. Wheeljack merupakan mekanik sekaligus ilmuan yang bisa berubah menjadi sebuah bus panel Volkswagen Tipe 2 tahun 1970-an. Sementara Mirage adalah autobots yang bisa mengubah dirinya menjadi Porsche 964 Carrera RS 3.8 serta dapat memproyeksikan hologram.\n', 'Fiksi Ilmiah, Aksi, Petualangan', , 'Adm-1-xxi5', 'Menyunting Data Film', '2023-06-08 06:35:19');
INSERT INTO `pilih_film` (`Id_film`, `Judul`, `Sinopsis`, `Genre`, `Foto_film`, `Id_Admin`, `desk_sunting`, `tanggal_sunting`) VALUES
(8, 'The Little Mermaid', 'Terinspirasi dari film animasi The Little Mermaid (1989) ini berfokus pada karakter putri duyung bernama Ariel. Dikisahkan bahwa, Ariel merupakan anak bungsu dari Raja Triton. Ia dikenal sebagai sosok putri duyung yang punya rasa ingin tahu yang tinggi dan sangat tertarik dengan kehidupan di permukaan laut. Hingga suatu hari, Ariel berenang ke permukaan dan menyaksikan petaka yang menimpa pangeran Eric. Tidak menunggu lama, Ariel pun menyelamatkan Eric yang nyaris tenggelam.\nIa membawa tubuh lemas Eric ke tepian pantai, lalu menyanyikannya sebuah lagu yang sempat membuat Eric terkesan dan hampir tersadar. Sebelum, akhirnya para prajurit menemukan keberadaannya yang sempat disangka menghilang.\nSejak, pertemuan pertamanya tersebut. Ariel telah jatuh cinta pada Eric. Ketertarikannya pada Eric didukung oleh impian besarnya menjadi manusia, mendorong Ariel untuk bertemu dengan Ursula, si penyihir. Pertemuan tersebut kemudian berbuah kesepakatan sekaligus penanda dimulainya petualangan baru bagi Ariel dan mara bahaya bagi Raja Triton.', 'Petualangan, Drama, Fantasi, Musikal.', , '', '', '2023-06-07 12:25:38');

